#include <iostream>
#include <fstream>
#include <sstream>
#include <string>
#include <vector>
#include <map>
#include <set>
#include <unordered_map>
#include <unordered_set>
#include <iterator>
#include <algorithm>

using namespace std;

class Solution {
 public:
  string shortestPalindrome(string s) {
    // 1) Find longest palindrome p starts at 0 (O(n) using kmp)
    // 2) Return reversed(s.substr(p.size())) + s

    // prefix function
    string sReversed = s;
    reverse(sReversed.begin(), sReversed.end());
    string t = s + "#" + sReversed;
    int m = t.size();
    vector<int> pi(m, 0);

    int k = 0;
    for (int i = 1; i < m; ++i) {
      while (k > 0 && t[k] != t[i]) {
        k = pi[k - 1];
      }
      if (t[k] == t[i]) {
        k += 1;
      }
      pi[i] = k;
    }

    // longest palindrome starts at 0 is pi[m-1]
    string pad = s.substr(pi[m - 1]);
    reverse(pad.begin(), pad.end());

    return pad + s;
  }
};

void test(string s) {
  std::cout << "s: " << s << "\n";
  Solution sol;
  std::cout << "shortestPalindrome: " << sol.shortestPalindrome(s) << "\n";
}

int main(int argc, char* argv[]) {
  {
    test("aacecaaa");
  }
  {
    test("abcd");
  }
  {
    test("");
  }
  {
    test("");
  }
  return 0;
}
